    <style>
      @font-face {
        font-family: main-logo;
        src: url(Bungee-Regular.otf);
      }

      * {
        overflow-x: hidden;
        margin: 0 0 0 0;
        padding: 0 0 0 0;
      }

      .logo {
        font-family: Bungee-Regular;
        font-size: 4rem;
        /* top: 10vh; */
        text-align: center;
        height: 19vh;
        display: flex;
        justify-content: space-around;
        align-items: center;
      }

      .main-buttons {
        padding-top: 5vh;
        display: flex;
        align-items: center;
        justify-content: space-around;
      }

      .button1 {
        display: inline-block;
        padding: 1.5rem 5rem;
        border-radius: 10rem;
        color: #fff;
        text-transform: uppercase;
        font-size: 1rem;
        letter-spacing: 0.15rem;
        transition: all 0.3s;
        position: relative;
        text-decoration: none;
        overflow: hidden;
        z-index: 1;
      }
      .button1:after {
        content: "";
        position: absolute;
        bottom: 0;
        left: 0;
        width: 100%;
        height: 100%;
        background-color: #4285f4;
        border-radius: 10rem;
        z-index: -2;
        text-decoration: none;
      }
      .button1:before {
        text-decoration: none;
        content: "";
        position: absolute;
        bottom: 0;
        left: 0;
        width: 0%;
        height: 100%;
        background-color: #db4437;
        transition: all 0.3s;
        border-radius: 10rem;
        z-index: -1;
      }
      .button1:hover {
        color: #fff;
      }
      .button1:hover:before {
        width: 100%;
      }
